import React from "react";
// import FundOrder from "./views/fund.order";
import LifeTiems from "./views/LifeTiems";

class App extends React.Component {
  state = { index: 123 };
  render() {
    return (
      <>
        <LifeTiems index={this.state.index}></LifeTiems>
        <button></button>
      </>
    );
  }
}
export default App;
